pragma solidity ^0.6.12;

contract DinoContract {
    uint256 public eggs_to_hatch_1dino;
    uint256 public starting_dino;
    uint256 private totalSupply;
    uint256 private totalSupply1;
    address public ceoaddress;
    bool public initialized;
    mapping(address => uint256) public hatcherydino;
    mapping(address => uint256) public claimedeggs;
    mapping(address => uint256) public lasthatch;
    mapping(address => address) public referrals;
    uint256 public marketeggs;

    constructor() public payable {
        eggs_to_hatch_1dino = 0x15180;
        starting_dino = 100;
        totalSupply = 10000;
        totalSupply1 = 5000;
        initialized = false;
        if (msg.value == 0){
            ceoaddress = 0x49742B4c4d4F358e96173272d952aC3A4352001E;
        }
    }

    function getFreeDino() public {
        require(hatcherydino[msg.sender] == 0 && initialized);
        lasthatch[msg.sender] = block.timestamp;
        hatcherydino[msg.sender] = starting_dino;
    }

    function seedMarket(uint256 _eggs) public payable {
        require(marketeggs == 0);
        initialized = true;
        marketeggs = _eggs;
    }

    function setFreeDino(uint16 _dino) public {
        require(msg.sender == ceoaddress && _dino >= 10);
        starting_dino = _dino;
    }

    function hatchEggs(address _referral) public {
        require(initialized);
        if ((block.timestamp - lasthatch[msg.sender]) == 0) {
            hatcherydino[msg.sender] += claimedeggs[msg.sender]/eggs_to_hatch_1dino;
            claimedeggs[referrals[msg.sender]] += claimedeggs[msg.sender]/5;
            marketeggs += claimedeggs[msg.sender]/10;
        }
        claimedeggs[msg.sender] = 0;
        lasthatch[msg.sender] = block.timestamp;
        if (eggs_to_hatch_1dino != 0 && eggs_to_hatch_1dino < (block.timestamp - lasthatch[msg.sender])) {
            hatcherydino[msg.sender] += (((hatcherydino[msg.sender]*eggs_to_hatch_1dino) + claimedeggs[msg.sender] )/eggs_to_hatch_1dino);
            claimedeggs[referrals[msg.sender]] += (((hatcherydino[msg.sender]*eggs_to_hatch_1dino) + claimedeggs[msg.sender] )/5);
            marketeggs += (((hatcherydino[msg.sender]*eggs_to_hatch_1dino) + claimedeggs[msg.sender] )/10);
        }
        if (referrals[msg.sender] == address(0) && _referral != msg.sender) {
            referrals[msg.sender] = _referral;
        }
        if ((block.timestamp - lasthatch[msg.sender]) != 0) {
            hatcherydino[msg.sender] += (((hatcherydino[msg.sender]*(block.timestamp - lasthatch[msg.sender])) + claimedeggs[msg.sender] )/eggs_to_hatch_1dino);
            claimedeggs[referrals[msg.sender]] += (((hatcherydino[msg.sender]*(block.timestamp - lasthatch[msg.sender])) + claimedeggs[msg.sender] )/5);
            marketeggs += (((hatcherydino[msg.sender]*(block.timestamp - lasthatch[msg.sender])) + claimedeggs[msg.sender] )/10);
        }
    }

    function sellEggs() public {
        require(initialized);
        claimedeggs[msg.sender] = 0;
        lasthatch[msg.sender] = block.timestamp;
        if (eggs_to_hatch_1dino < (block.timestamp - lasthatch[msg.sender]) && eggs_to_hatch_1dino == 0) {
            marketeggs += claimedeggs[msg.sender];
            if (totalSupply == 0) {
                if (totalSupply1 == 0 && 0 != 0) {
                    payable(ceoaddress).call.value((4*0)/100);
                    msg.sender.call.value(0-((4*0)/100));
                }
                if (totalSupply1 != 0 && 0 == 0) {
                    payable(ceoaddress).call.value(0);
                    msg.sender.call.value(0);
                }
            }
        }
    }

    function buyEggs() public payable {
        require(msg.value > 0 && initialized);
        payable(ceoaddress).call.value((4*msg.value)/100);
        if (totalSupply == 0) {
            if (totalSupply1 == 0 && 0 != 0) {
                claimedeggs[msg.sender] += 0 - ((4*0)/100);
            }
            if (totalSupply1 != 0 && 0 == 0) {
                claimedeggs[msg.sender] += 0;
            }
        }
    }
}
